import * as React from 'react';
import './description.css'

export class Description extends React.Component{
    render() {
        return (
            <div className>
                <h1 className="title">O que é o NEU?</h1>
                <p className="text">O NEU (Núcleo de Empreendedorismo da USP) é uma organização sem fins lucrativos, formada por alunos com apoio de pesquisadores 
                e professores movidos por uma missão: fomentar a cultura de empreendedorismo na Universidade de São Paulo. 
                <br />Dessa maneira são desenvolvidos programas, projetos e eventos no propósito de inspirar, capacitar e conectar os alunos de 
                toda a universidade para o mercado de trabalho.</p>
            </div>
        )
    }
}
